style.css:
@-moz-document url-prefix("https://search.brave.com/"){
  :root.dark {
    --body-bg: #212121;
    --bg-0: #2a2a2a;
    --bg-01: #2a2a2a;
    --bg-02: #2a2a2a;
    --bg-glassy: #2c2c2c;
    --bg-1: #3a3a3a;
    --bg-2: #282828;
    --bg-02: #2a2a2a;
    --bg-3: #1f1f1f;
    --bg-green: #a7f0ba;
    --bg-blue: #d0e2ff;
    --bg-red: #ffd6e8;
    --bg-inverse: #ffffff;
    --bg-0-opacity: #1b1b1bbd;
    --bg-favicon: #3a3a3a;
    --bg-placeholder: #1d1f27;
    --color-primary: #c9d4dc;
    --color-primary-2: #bcbcbc;
    --color-primary-3: #c9d4dc;
    --color-inverse: #ffffff;
    --color-gray: #919191;
    --color-gray-2: #b5c1ca;
    --color-gray-3: #7e8790;
    --color-gray-4: #7E8790;
    --color-gray-5: #7E8790;
    --color-green: #0f9d58;
    --color-red: #d23f31;
    --color-blue: #0043ce;
    --link-primary: #c9d4dc;
    --link-secondary: #737d87;
    --link-visited: #727B86;
    --link-hover: #d7e0e9;
    --theme-purple: #7675fd;
    --theme-yellow: #F8BE2D;
    --border-color: #333;
    --border-color-1: #272626;
    --border-color-favicon: #545761;
    --blurple-300: #A0A5EB;
    --text-02: #C2C4CF;
    --text-03: #84889C;
    --interactive-04: #353DAB;
    --interactive-05: #4C54D2;
    --interactive-06: #737ADE;
    --interactive-07: #F0F2FF;
    --interactive-08: #5E6175;
    --focus-border: var(--blurple-300);
    --divider-01: #3a3a3a;
    --disabled: #3a3a3a;
    --btn-filled-bg: var(--interactive-05);
    --btn-filled-bg-hover: var(--interactive-06);
    --btn-filled-text: #ffffff;
    --btn-filled-text-active: rgba(255, 255, 255, 0.7);
    --btn-filled-bg-active: rgba(115, 122, 222, 0.7);
    --btn-filled-text-disabled: #677078;
    --btn-outline-border: var(--interactive-08);
    --btn-outline-border-hover: var(--interactive-06);
    --btn-outline-text: var(--interactive-07);
    --btn-outline-text-hover: var(--blurple-300);
    --btn-outline-text-active: rgba(160, 165, 235, 0.7);
    --btn-outline-border-active: rgba(115, 122, 222, 0.7);
    --btn-outline-text-disabled: #495057;
    --btn-icon-svg-hover: var(--focus-border);
    --btn-icon-bg-hover: rgba(160, 165, 235, 0.32);
    --btn-icon-svg-active: rgba(160, 165, 235, 0.7);
    --code-color-gray: #bcbcbc;
    --code-bg-0: #383e49;
    --code-color-1: #5C6370;
    --code-color-2: #abb2bf;
    --code-color-3: #e06c75;
    --code-color-4: #d19a66;
    --code-color-5: #98c379;
    --code-color-6: #56b6c2;
    --shadow-1: 0 1px 1px 0 rgba(66, 66, 66, 0.08), 0 1px 3px 1px rgba(66, 66, 66, 0.16);
    --shadow-2: 0 1px 6px rgba(32, 33, 36, 0.28);
  }
}
